--
-- Name: copy_bmsformulary_to_sa(); Type: FUNCTION; Schema: public; Owner: ff_new
--

CREATE FUNCTION copy_bmsformulary_to_sa() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
    DECLARE
    	copy_class 	integer;
        source_site integer;
        new_sa_id 	integer;
    BEGIN
		-- drug class that we care about (dev: 131, prod: 132)
		copy_class := 132;
		-- the ff_site id value for the BMS site (3)
		source_site := 3;
		
		-- See if the record is for the class we care about and that it isn't a duplicate from SA
		IF (OLD.drugclassfid = copy_class) THEN
			-- If we're deleteing the row from BMS, clear the source info on the SA record
	        IF (TG_OP = 'DELETE' AND OLD.sourceFormularyFid IS NULL) THEN
				
		            UPDATE saformulary
	                SET sourceSiteFid = NULL,
	                	sourceFormularyFid = NULL
	                WHERE sourceSiteFid = source_site AND sourceFormularyFid = OLD.entityid;
		        
	        ELSIF (TG_OP = 'UPDATE') THEN
				-- If we're setting an unpublished formulary to published, copy it over
	            IF (OLD.ispublished = 0 AND NEW.ispublished = 1 AND NEW.sourceFormularyFid IS NULL) THEN
	            	
	            	INSERT INTO saformulary 
	            		(sourceSiteFid, sourceFormularyFid, userfid, districtfid, drugclassfid, planlist, planorderedlist, planboldedlist, druglist, 
	            			tableversion, versionnumber, ispublished, isexported, isactive, publishtimestamp, exporttimestamp, 
	            			createtimestamp, modifytimestamp, mostrecent, msa, fullmsa, coveredtext, 
	            			commercialPlanOrdered, medicarePlanOrdered, medicaidPlanOrdered)
	            	VALUES 
	            		(source_site, NEW.entityid, 0, NEW.districtfid, NEW.drugclassfid, NEW.planlist, NEW.planorderedlist, NEW.planboldedlist, NEW.druglist, 
	            			NEW.tableversion, NEW.versionnumber, NEW.ispublished, NEW.isexported, NEW.isactive, NEW.publishtimestamp, NEW.exporttimestamp, 
	            			NEW.createtimestamp, NEW.modifytimestamp, NEW.mostrecent, NEW.msa, NEW.fullmsa, NEW.coveredtext, 
	            			NEW.commercialPlanOrdered, NEW.medicarePlanOrdered, NEW.medicaidPlanOrdered);
	            	
	            	SELECT max(entityid) INTO new_sa_id FROM saformulary WHERE sourcesitefid = source_site and sourceFormularyFid = NEW.entityid;

				INSERT INTO sadrugplanform
					(formularyfid, planid, drugid, coveragestatus, priorauth, quantlimit, stepther, restrother, resetflag, reasoncodefid, paforall, saplanname, satierfid)
				SELECT new_sa_id AS formularyfid, planid, drugid, coveragestatus, priorauth, quantlimit, stepther, restrother, resetflag, reasoncodefid, paforall, bmsplanname AS saplanname, bmstierfid AS satierfid
				FROM bmsdrugplanform
				WHERE formularyfid = NEW.entityid;
		
	            	-- Insert formulary state cross refs
	            	INSERT INTO saformularystate (entityfid, statefid) SELECT new_sa_id, statefid FROM bmsformularystate WHERE entityfid = NEW.entityid;
	            	
	        	ELSIF (OLD.isexported = 0 AND NEW.isexported = 1) THEN
	        		IF (NEW.sourceFormularyFid IS NULL) THEN 
		        		UPDATE saformulary
		                SET isexported = NEW.isexported,
		                	exporttimestamp = NEW.exporttimestamp,
		                	modifytimestamp = NEW.modifytimestamp
		                WHERE sourceSiteFid = source_site AND sourceFormularyFid = NEW.entityid;
		            ELSE 
		            	UPDATE saformulary
		                SET isexported = NEW.isexported,
		                	exporttimestamp = NEW.exporttimestamp,
		                	modifytimestamp = NEW.modifytimestamp
		                WHERE entityid = NEW.sourceFormularyFid;
	        		END IF;
	            END IF;
	        END IF;
        END IF;

        RETURN NULL;

    END;
$$;


ALTER FUNCTION public.copy_bmsformulary_to_sa() OWNER TO ff_new;

--
-- Name: copy_saformulary_to_bms(); Type: FUNCTION; Schema: public; Owner: ff_new
--

CREATE FUNCTION copy_saformulary_to_bms() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
    DECLARE
    	copy_class 	integer;
        source_site integer;
        new_bms_id 	integer;
    BEGIN
		-- drug class that we care about (dev: 131, prod: 132)
		copy_class := 132;
		-- the ff_site id value for the SA site (2)
		source_site := 2;
		
		-- See if the record is for the class we care about and that it isn't a duplicate from SA
		IF (OLD.drugclassfid = copy_class) THEN
		
			-- If we're deleteing the row from BMS, clear the source info on the SA record
	        IF (TG_OP = 'DELETE' AND OLD.sourceFormularyFid IS NULL) THEN
				
		            UPDATE bmsformulary
	                SET sourceSiteFid = NULL,
	                	sourceFormularyFid = NULL
	                WHERE sourceSiteFid = source_site AND sourceFormularyFid = OLD.entityid;
		        
	        ELSIF (TG_OP = 'UPDATE') THEN
				-- If we're setting an unpublished formulary to published, copy it over
	            IF (OLD.ispublished = 0 AND NEW.ispublished = 1 AND NEW.sourceFormularyFid IS NULL) THEN
	            
	            	-- Insert main formulary entry
	            	INSERT INTO bmsformulary 
	            		(sourceSiteFid, sourceFormularyFid, userfid, districtfid, drugclassfid, planlist, planorderedlist, planboldedlist, druglist, 
	            			tableversion, versionnumber, ispublished, isexported, isactive, publishtimestamp, exporttimestamp, 
	            			createtimestamp, modifytimestamp, mostrecent, msa, fullmsa, coveredtext, 
	            			commercialPlanOrdered, medicarePlanOrdered, medicaidPlanOrdered)
	            	VALUES 
	            		(source_site, NEW.entityid, 0, NEW.districtfid, NEW.drugclassfid, NEW.planlist, NEW.planorderedlist, NEW.planboldedlist, NEW.druglist, 
	            			NEW.tableversion, NEW.versionnumber, NEW.ispublished, NEW.isexported, NEW.isactive, NEW.publishtimestamp, NEW.exporttimestamp, 
	            			NEW.createtimestamp, NEW.modifytimestamp, NEW.mostrecent, NEW.msa, NEW.fullmsa, NEW.coveredtext, 
	            			NEW.commercialPlanOrdered, NEW.medicarePlanOrdered, NEW.medicaidPlanOrdered);

	            	SELECT max(entityid) INTO new_bms_id FROM bmsformulary WHERE sourcesitefid = source_site and sourceFormularyFid = NEW.entityid;

				INSERT INTO bmsdrugplanform
					(formularyfid, planid, drugid, coveragestatus, priorauth, quantlimit, stepther, restrother, resetflag, reasoncodefid, paforall, bmsplanname, bmstierfid)
				SELECT new_bms_id AS formularyfid, planid, drugid, coveragestatus, priorauth, quantlimit, stepther, restrother, resetflag, reasoncodefid, paforall, saplanname AS bmsplanname, satierfid AS bmstierfid
				FROM sadrugplanform
				WHERE formularyfid = NEW.entityid;

	            	-- Insert formulary state cross refs
	            	INSERT INTO bmsformularystate (entityfid, statefid) SELECT new_bms_id, statefid FROM saformularystate WHERE entityfid = NEW.entityid;
	            	    
	        	ELSIF (OLD.isexported = 0 AND NEW.isexported = 1) THEN
	        		IF (NEW.sourceFormularyFid IS NULL) THEN 
		        		UPDATE bmsformulary
		                SET isexported = NEW.isexported,
		                	exporttimestamp = NEW.exporttimestamp,
		                	modifytimestamp = NEW.modifytimestamp
		                WHERE sourceSiteFid = source_site AND sourceFormularyFid = NEW.entityid;
		            ELSE 
		            	UPDATE bmsformulary
		                SET isexported = NEW.isexported,
		                	exporttimestamp = NEW.exporttimestamp,
		                	modifytimestamp = NEW.modifytimestamp
		                WHERE entityid = NEW.sourceFormularyFid;
	        		END IF;
	           END IF;
	        END IF;
        END IF;

        RETURN NULL;
        
    END;
$$;


