-- Name: health_plan_count_for_wk_plan(integer); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION health_plan_count_for_wk_plan(integer) RETURNS bigint
    LANGUAGE sql STABLE STRICT
    AS $_$
    SELECT 
      COUNT(1) 
    FROM healthplan h
    LEFT JOIN healthplan_wk_plan hw ON hw.healthplanfid = h.id
    WHERE 
      hw.wk_planfid = $1
      AND h.isactive = true
  $_$;


