--
-- Name: v_plan_copay; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW v_plan_copay AS
SELECT bs.healthplanfid AS health_plan_id, bscv.tierfid AS tier_id, COALESCE(bscv.value) AS copay_value, COALESCE(bscv.percentage) AS copay_percentage FROM ((((benefitstructurecopayvalue bscv JOIN benefitstructurecopay bsc ON ((bscv.benefitstructurecopayfid = bsc.id))) JOIN benefitstructure bs ON ((bsc.benefitstructurefid = bs.id))) JOIN benefitstructurepharmacytype bspt ON ((bsc.pharmacytypefid = bspt.id))) JOIN benefitstructurecopaytype bsct ON ((bsc.copaytypefid = bsct.id))) WHERE ((bspt.id = 1) AND (bsct.id = 2));


ALTER TABLE v_plan_copay OWNER TO postgres;

--
-- Name: v_plan_copay_min_max; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW v_plan_copay_min_max AS
SELECT a.health_plan_id, a.tier_id, COALESCE(a.min_copay_value, (0)::numeric) AS min_copay_value, COALESCE(b.max_copay_value, (0)::numeric) AS max_copay_value, COALESCE(c.min_copay_percentage, (0)::numeric) AS min_copay_percentage, COALESCE(d.max_copay_percentage, (0)::numeric) AS max_copay_percentage FROM ((((SELECT v_plan_copay.health_plan_id, v_plan_copay.tier_id, min(v_plan_copay.copay_value) AS min_copay_value FROM v_plan_copay GROUP BY v_plan_copay.health_plan_id, v_plan_copay.tier_id) a LEFT JOIN (SELECT v_plan_copay.health_plan_id, v_plan_copay.tier_id, max(v_plan_copay.copay_value) AS max_copay_value FROM v_plan_copay GROUP BY v_plan_copay.health_plan_id, v_plan_copay.tier_id) b ON (((a.health_plan_id = b.health_plan_id) AND (a.tier_id = b.tier_id)))) LEFT JOIN (SELECT v_plan_copay.health_plan_id, v_plan_copay.tier_id, min(v_plan_copay.copay_percentage) AS min_copay_percentage FROM v_plan_copay GROUP BY v_plan_copay.health_plan_id, v_plan_copay.tier_id) c ON (((a.health_plan_id = c.health_plan_id) AND (a.tier_id = c.tier_id)))) LEFT JOIN (SELECT v_plan_copay.health_plan_id, v_plan_copay.tier_id, max(v_plan_copay.copay_percentage) AS max_copay_percentage FROM v_plan_copay GROUP BY v_plan_copay.health_plan_id, v_plan_copay.tier_id) d ON (((a.health_plan_id = d.health_plan_id) AND (a.tier_id = d.tier_id))));


ALTER TABLE v_plan_copay_min_max OWNER TO postgres;

--
-- Name: v_plan_product_formulary_with_webnames; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW v_plan_product_formulary_with_webnames AS
SELECT a.id AS health_plan_id, a.displayid AS health_plan_display_id, a.name AS health_plan_name, a.webname AS health_plan_web_name, a.healthplantypefid AS health_plan_type_id, hpt.name AS health_plan_type_name, a.providerfid AS provider_id, prv.name AS provider_name, prv.webname AS provider_web_name, a.tiers AS plan_tiers, a.tierstructure AS tier_structure, f.preferred_brand_tier_id, a.formularyfid AS formulary_id, d.id AS drug_id, d.displayid AS drug_display_id, d.name AS drug_name, d.webname AS drug_web_name, fe.tierfid AS tier_id, CASE WHEN (feq1.pa = 1) THEN 1 ELSE 0 END AS pa, CASE WHEN (feq2.ql = 1) THEN 1 ELSE 0 END AS ql, CASE WHEN (feq3.st = 1) THEN 1 ELSE 0 END AS st, CASE WHEN (feq4."or" = 1) THEN 1 ELSE 0 END AS "or", cp.min_copay_value, cp.max_copay_value, cp.min_copay_percentage, cp.max_copay_percentage, fe.reasoncodefid AS reason_code_id, rc.code AS reason_code, rc.text AS reason_code_text, rc.webtext AS reason_code_web_text, fe.restriction_comments, fe.updated_at FROM (((((((((((healthplan a JOIN formulary f ON ((a.formularyfid = f.id))) JOIN formularyentry fe ON ((a.formularyfid = fe.formularyfid))) JOIN drug d ON ((fe.drugfid = d.id))) JOIN healthplantype hpt ON ((a.healthplantypefid = hpt.id))) LEFT JOIN (SELECT 1 AS pa, formularyentryqualifier.formularyentryfid FROM formularyentryqualifier WHERE (formularyentryqualifier.qualifierfid = 2)) feq1 ON ((fe.id = feq1.formularyentryfid))) LEFT JOIN (SELECT 1 AS ql, formularyentryqualifier.formularyentryfid FROM formularyentryqualifier WHERE (formularyentryqualifier.qualifierfid = 1)) feq2 ON ((fe.id = feq2.formularyentryfid))) LEFT JOIN (SELECT 1 AS st, formularyentryqualifier.formularyentryfid FROM formularyentryqualifier WHERE (formularyentryqualifier.qualifierfid = 3)) feq3 ON ((fe.id = feq3.formularyentryfid))) LEFT JOIN (SELECT 1 AS "or", formularyentryqualifier.formularyentryfid FROM formularyentryqualifier WHERE (formularyentryqualifier.qualifierfid = 4)) feq4 ON ((fe.id = feq4.formularyentryfid))) LEFT JOIN v_plan_copay_min_max cp ON (((a.id = cp.health_plan_id) AND (fe.tierfid = cp.tier_id)))) LEFT JOIN reasoncode rc ON ((fe.reasoncodefid = rc.id))) LEFT JOIN provider prv ON ((a.providerfid = prv.id))) WHERE ((a.isactive = true) AND (d.isactive = true));


ALTER TABLE v_plan_product_formulary_with_webnames OWNER TO postgres;

