--
-- Name: ims_plan_health_plan_lives_allocation; Type: VIEW; Schema: public; Owner: ff_new
--

CREATE VIEW ims_plan_health_plan_lives_allocation AS
SELECT imshealthplan.id, imshealthplan.id AS ims_health_plan_id, health_plan_lives.lives AS health_plan_lives, ims_plan_lives.lives AS ims_plan_lives, ims_plan_count.count AS health_plan_count, CASE WHEN (ims_plan_lives.lives = (0)::numeric) THEN 'health_plan_count'::text ELSE 'lives'::text END AS allocation_paradigm, CASE WHEN (ims_plan_lives.lives = (0)::numeric) THEN (1.0 / (ims_plan_count.count)::numeric) ELSE (health_plan_lives.lives / ims_plan_lives.lives) END AS allocation FROM (((((imshealthplan JOIN healthplan ON ((healthplan.id = imshealthplan.healthplanfid))) JOIN imsplan ON ((imsplan.id = imshealthplan.imsfid))) JOIN (SELECT healthplan.id AS health_plan_id, COALESCE(sum(healthplan_countylives.lives), (0)::numeric) AS lives FROM (healthplan LEFT JOIN healthplan_countylives ON ((healthplan_countylives.healthplanfid = healthplan.id))) WHERE (healthplan.isactive = true) GROUP BY healthplan.id) health_plan_lives ON ((health_plan_lives.health_plan_id = imshealthplan.healthplanfid))) JOIN (SELECT imsplan.id AS ims_plan_id, COALESCE(sum(healthplan_countylives.lives), (0)::numeric) AS lives FROM (((imsplan LEFT JOIN imshealthplan ON ((imshealthplan.imsfid = imsplan.id))) LEFT JOIN healthplan ON (((healthplan.id = imshealthplan.healthplanfid) AND (healthplan.isactive = true)))) LEFT JOIN healthplan_countylives ON ((healthplan_countylives.healthplanfid = healthplan.id))) WHERE (imsplan.isactive = true) GROUP BY imsplan.id) ims_plan_lives ON ((ims_plan_lives.ims_plan_id = imshealthplan.imsfid))) JOIN (SELECT imsplan.id AS ims_plan_id, count(healthplan.id) AS count FROM ((imsplan LEFT JOIN imshealthplan ON ((imshealthplan.imsfid = imsplan.id))) LEFT JOIN healthplan ON ((healthplan.id = imshealthplan.healthplanfid))) WHERE ((imsplan.isactive = true) AND (healthplan.isactive = true)) GROUP BY imsplan.id) ims_plan_count ON ((ims_plan_count.ims_plan_id = imshealthplan.imsfid))) WHERE ((healthplan.isactive = true) AND (imsplan.isactive = true));


ALTER TABLE ims_plan_health_plan_lives_allocation OWNER TO ff_new;

