ryqualifier.formularyentryfid FROM formularyentryqualifier WHERE (formularyentryqualifier.qualifierfid = 4)) feq4 ON ((fe.id = feq4.formularyentryfid))) LEFT JOIN v_plan_copay_min_max cp ON (((a.id = cp.health_plan_id) AND (fe.tierfid = cp.tier_id)))) LEFT JOIN reasoncode rc ON ((fe.reasoncodefid = rc.id))) LEFT JOIN provider prv ON ((a.providerfid = prv.id))) WHERE ((a.isactive = true) AND (d.isactive = true));


