SELECT hp.id AS health_plan_id, hps.statefid AS state_id, t.id AS tier_id, (SELECT cov.value FROM (((benefitstructure bs JOIN benefitstructurecopay co ON ((bs.id = co.benefitstructurefid))) JOIN benefitstructurecopayvalue cov ON ((co.id = cov.benefitstructurecopayfid))) LEFT JOIN benefitstructurestate ss ON ((bs.id = ss.benefitstructurefid))) WHERE ((((((bs.healthplanfid = hp.id) AND CASE WHEN (hp.healthplantypefid = ANY (ARRAY[5, 6, 7])) THEN (ss.statefid = hps.statefid) ELSE true END) AND (cov.tierfid = t.id)) AND (co.pharmacytypefid = 1)) AND (co.copaytypefid = 2)) AND (cov.value IS NOT NULL)) ORDER BY cov.value LIMIT 1) AS copay_min, (SELECT CASE WHEN (cov.max IS NULL) THEN cov.value ELSE cov.max END AS vmax FROM (((benefitstructure bs JOIN benefitstructurecopay co ON ((bs.id = co.benefitstructurefid))) JOIN benefitstructurecopayvalue cov ON ((co.id = cov.benefitstructurecopayfid))) LEFT JOIN benefitstructurestate ss ON ((bs.id = ss.benefitstructurefid))) WHERE ((((((bs.healthplanfid = hp.id) AND CASE WHEN (hp.healthplantypefid = ANY (ARRAY[5, 6, 7])) THEN (ss.statefid = hps.statefid) ELSE true END) AND (cov.tierfid = t.id)) AND (co.pharmacytypefid = 1)) AND (co.copaytypefid = 2)) AND ((cov.value IS NOT NULL) OR (cov.max IS NOT NULL))) ORDER BY CASE WHEN (cov.max IS NULL) THEN cov.value ELSE cov.max END DESC LIMIT 1) AS copay_max, (SELECT cov.percentage FROM (((benefitstructure bs JOIN benefitstructurecopay co ON ((bs.id = co.benefitstructurefid))) JOIN benefitstructurecopayvalue cov ON ((co.id = cov.benefitstructurecopayfid))) LEFT JOIN benefitstructurestate ss ON ((bs.id = ss.benefitstructurefid))) WHERE ((((((bs.healthplanfid = hp.id) AND CASE WHEN (hp.healthplantypefid = ANY (ARRAY[5, 6, 7])) THEN (ss.statefid = hps.statefid) ELSE true END) AND (cov.tierfid = t.id)) AND (co.pharmacytypefid = 1)) AND (co.copaytypefid = 2)) AND (cov.percentage IS NOT NULL)) ORDER BY cov.percentage LIMIT 1) AS coinsurance_min, (SELECT cov.percentage FROM (((benefitstructure bs JOIN benefitstructurecopay co ON ((bs.id = co.benefitstructurefid))) JOIN benefitstructurecopayvalue cov ON ((co.id = cov.benefitstructurecopayfid))) LEFT JOIN benefitstructurestate ss ON ((bs.id = ss.benefitstructurefid))) WHERE ((((((bs.healthplanfid = hp.id) AND CASE WHEN (hp.healthplantypefid = ANY (ARRAY[5, 6, 7])) THEN (ss.statefid = hps.statefid) ELSE true END) AND (cov.tierfid = t.id)) AND (co.pharmacytypefid = 1)) AND (co.copaytypefid = 2)) AND (cov.percentage IS NOT NULL)) ORDER BY cov.percentage DESC LIMIT 1) AS coinsurance_max FROM ((healthplan hp JOIN healthplanstate hps ON ((hp.id = hps.healthplanfid))) CROSS JOIN tier t) WHERE ((hp.isactive IS TRUE) AND (t.id = ANY (ARRAY[1, 2, 3, 4, 5, 6, 7])));


