d))) JOIN restrictionreport rr ON ((fce.reportfid = rr.id))) JOIN restrictionreportsite rrs ON ((rr.id = rrs.reportfid))) JOIN bms_restriction_code_display bd ON ((ce.criteriafid = bd.criteria_id))) WHERE (((((fce.feqfid = ro.id) AND (fce.reportfid = 30)) AND (rrs.sitefid = 3)) AND ((fce.restrictionflag)::text = 'yes'::text)) AND (bd.qualifier_id = 4))) ELSE 0 END AS display_or, CASE WHEN (pa.id IS NOT NULL) THEN 1 ELSE 0 END AS original_pa, CASE WHEN (ql.id IS NOT NULL) THEN 1 ELSE 0 END AS original_ql, CASE WHEN (st.id IS NOT NULL) THEN 1 ELSE 0 END AS original_st, CASE WHEN (ro.id IS NOT NULL) THEN 1 ELSE 0 END AS original_or FROM ((((((healthplan hp JOIN formularyentry fe ON ((hp.formularyfid = fe.formularyfid))) LEFT JOIN formularyentryqualifier pa ON (((fe.id = pa.formularyentryfid) AND (pa.qualifierfid = 2)))) LEFT JOIN formularyentryqualifier ql ON (((fe.id = ql.formularyentryfid) AND (ql.qualifierfid = 1)))) LEFT JOIN formularyentryqualifier st ON (((fe.id = st.formularyentryfid) AND (st.qualifierfid = 3)))) LEFT JOIN formularyentryqualifier ro ON (((fe.id = ro.formularyentryfid) AND (ro.qualifierfid = 4)))) LEFT JOIN reasoncode rc ON ((fe.reasoncodefid = rc.id))) WHERE ((hp.isactive IS TRUE) AND (fe.drugfid = 2767));


