(SELECT custom_payors.id AS "TCPI_ID", custom_payors.name AS "TCPI_Name", parents.id AS "Parent_ID", parents.name AS "Parent_Name", provider.id AS "Provider_ID", provider.name AS "Provider_Name", healthplan.id AS "Plan_ID", healthplan.name AS "Plan_Name", CASE WHEN (healthplantype.id = ANY (ARRAY[1, 2, 3, 12, 4, 9, 11])) THEN 'Commercial'::text WHEN (healthplantype.id = 10) THEN 'Medicaid'::text WHEN (healthplantype.id = ANY (ARRAY[5, 6, 7])) THEN 'Part D'::text WHEN (healthplantype.id = 8) THEN 'Federal'::text ELSE NULL::text END AS "Plan_Type_Group", healthplantype.name AS "Plan_Type", COALESCE(fm_pbm.id, 999999) AS "FF_PBM_ID", COALESCE(fm_pbm.name, 'FF FM PBM DOES NOT EXIST'::character varying) AS "FF_PBM_Description", COALESCE(cp_pbm.id, 999999) AS "CP_PBM_ID", COALESCE(cp_pbm.name, 'FF CP PBM DOES NOT EXIST'::character varying) AS "CP_PBM_Description", COALESCE(mo1_pbm.id, 999999) AS "MO1_PBM_ID", COALESCE(mo1_pbm.name, 'FF MO1 PBM DOES NOT EXIST'::character varying) AS "MO1_PBM_Description", COALESCE(mo2_pbm.id, 999999) AS "MO2_PBM_ID", COALESCE(mo2_pbm.name, 'FF MO2 PBM DOES NOT EXIST'::character varying) AS "MO2_PBM_Description", COALESCE(rm_pbm.id, 999999) AS "RM_PBM_ID", COALESCE(rm_pbm.name, 'FF RM PBM DOES NOT EXIST'::character varying) AS "RM_PBM_Description", view_active_health_plans_state_msa_lives.lives AS "Lives", metrostatarea.name AS "MSA", state.abbreviation AS "State", replace((COALESCE(formulary.preferred_brand_tier_id, 0))::text, (0)::text, '2'::text) AS "Preferred_Brand_Tier" FROM ((((((((((((((((healthplan JOIN healthplantype ON ((healthplan.healthplantypefid = healthplantype.id))) JOIN healthplanstate ON ((healthplan.id = healthplanstate.healthplanfid))) JOIN state ON ((healthplanstate.statefid = state.id))) JOIN state_metrostatarea ON ((state.id = state_metrostatarea.statefid))) JOIN metrostatarea ON ((state_metrostatarea.metrostatareafid = metrostatarea.id))) JOIN provider ON ((healthplan.providerfid = provider.id))) JOIN parents ON ((provider.parentsfid = parents.id))) JOIN formulary ON ((healthplan.formularyfid = formulary.id))) JOIN takeda.custom_payors_health_plans ON ((custom_payors_health_plans.health_plan_id = healthplan.id))) JOIN takeda.custom_payors ON ((custom_payors.id = custom_payors_health_plans.custom_payor_id))) LEFT JOIN view_active_health_plans_state_msa_lives ON ((((healthplan.id = view_active_health_plans_state_msa_lives.health_plan_id) AND (state.id = view_active_health_plans_state_msa_lives.state_id)) AND (metrostatarea.id = view_active_health_plans_state_msa_lives.msa_id)))) LEFT JOIN (SELECT healthplanpbm.healthplanfid, pbm.name, pbm.id FROM (healthplanpbm LEFT JOIN pbm ON ((healthplanpbm.pbmfid = pbm.id))) WHERE (healthplanpbm.pbmfunctionfid = 3)) fm_pbm ON ((healthplan.id = fm_pbm.healthplanfid))) LEFT JOIN (SELECT healthplanpbm.healthplanfid, pbm.name, pbm.id FROM (healthplanpbm LEFT JOIN pbm ON ((healthplanpbm.pbmfid = pbm.id))) WHERE (healthplanpbm.pbmfunctionfid = 2)) cp_pbm ON ((healthplan.id = cp_pbm.healthplanfid))) LEFT JOIN (SELECT healthplanpbm.healthplanfid, pbm.name, pbm.id FROM (healthplanpbm LEFT JOIN pbm ON ((healthplanpbm.pbmfid = pbm.id))) WHERE (healthplanpbm.pbmfunctionfid = 4)) mo1_pbm ON ((healthplan.id = mo1_pbm.healthplanfid))) LEFT JOIN (SELECT healthplanpbm.healthplanfid, pbm.name, pbm.id FROM (healthplanpbm LEFT JOIN pbm ON ((healthplanpbm.pbmfid = pbm.id))) WHERE (healthplanpbm.pbmfunctionfid = 7)) mo2_pbm ON ((healthplan.id = mo2_pbm.healthplanfid))) LEFT JOIN (SELECT healthplanpbm.healthplanfid, pbm.name, pbm.id FROM (healthplanpbm LEFT JOIN pbm ON ((healthplanpbm.pbmfid = pbm.id))) WHERE (healthplanpbm.pbmfunctionfid = 5)) rm_pbm ON ((healthplan.id = rm_pbm.healthplanfid))) WHERE (healthplan.isactive IS TRUE) ORDER BY custom_payors.id, parents.id, provider.id, healthplan.id, state.id) UNION (SELECT custom_payors.id AS "TCPI_ID", custom_payors.name AS "TCPI_Name", parents.id AS "Parent_ID", parents.name AS "Parent_Name", provider.id AS "Provider_ID", provider.name AS "Provider_Name", healthplan.id AS "Plan_ID", healthplan.name AS "Plan_Name", CASE WHEN (healthplantype.id = ANY (ARRAY[1, 2, 3, 12, 4, 9, 11])) THEN 'Commercial'::text WHEN (healthplantype.id = 10) THEN 'Medicaid'::text WHEN (healthplantype.id = ANY (ARRAY[5, 6, 7])) THEN 'Part D'::text WHEN (healthplantype.id = 8) THEN 'Federal'::text ELSE NULL::text END AS "Plan_Type_Group", healthplantype.name AS "Plan_Type", COALESCE(fm_pbm.id, 999999) AS "FF_PBM_ID", COALESCE(fm_pbm.name, 'FF FM PBM DOES NOT EXIST'::character varying) AS "FF_PBM_Description", COALESCE(cp_pbm.id, 999999) AS "CP_PBM_ID", COALESCE(cp_pbm.name, 'FF CP PBM DOES NOT EXIST'::character varying) AS "CP_PBM_Description", COALESCE(mo1_pbm.id, 999999) AS "MO1_PBM_ID", COALESCE(mo1_pbm.name, 'FF MO1 PBM DOES NOT EXIST'::character varying) AS "MO1_PBM_Description", COALESCE(mo2_pbm.id, 999999) AS "MO2_PBM_ID", COALESCE(mo2_pbm.name, 'FF MO2 PBM DOES NOT EXIST'::character varying) AS "MO2_PBM_Description", COALESCE(rm_pbm.id, 999999) AS "RM_PBM_ID", COALESCE(rm_pbm.name, 'FF RM PBM DOES NOT EXIST'::character varying) AS "RM_PBM_Description", view_active_health_plans_state_non_msa_lives.non_msa_lives AS "Lives", 'Non-MSA'::character varying AS "MSA", state.abbreviation AS "State", replace((COALESCE(formulary.preferred_brand_tier_id, 0))::text, (0)::text, '2'::text) AS "Preferred_Brand_Tier" FROM ((((((((((((((healthplan JOIN healthplantype ON ((healthplan.healthplantypefid = healthplantype.id))) JOIN healthplanstate ON ((healthplan.id = healthplanstate.healthplanfid))) JOIN state ON ((healthplanstate.statefid = state.id))) JOIN provider ON ((healthplan.providerfid = provider.id))) JOIN parents ON ((provider.parentsfid = parents.id))) JOIN formulary ON ((healthplan.formularyfid = formulary.id))) JOIN takeda.custom_payors_health_plans ON ((custom_payors_health_plans.health_plan_id = healthplan.id))) JOIN takeda.custom_payors ON ((custom_payors.id = custom_payors_health_plans.custom_payor_id))) LEFT JOIN view_active_health_plans_state_non_msa_lives ON (((healthplan.id = view_active_health_plans_state_non_msa_lives.health_plan_id) AND (state.id = view_active_health_plans_state_non_msa_lives.state_id)))) LEFT JOIN (SELECT healthplanpbm.healthplanfid, pbm.name, pbm.id FROM (healthplanpbm LEFT JOIN pbm ON ((healthplanpbm.pbmfid = pbm.id))) WHERE (healthplanpbm.pbmfunctionfid = 3)) fm_pbm ON ((healthplan.id = fm_pbm.healthplanfid))) LEFT JOIN (SELECT healthplanpbm.healthplanfid, pbm.name, pbm.id FROM (healthplanpbm LEFT JOIN pbm ON ((healthplanpbm.pbmfid = pbm.id))) WHERE (healthplanpbm.pbmfunctionfid = 2)) cp_pbm ON ((healthplan.id = cp_pbm.healthplanfid))) LEFT JOIN (SELECT healthplanpbm.healthplanfid, pbm.name, pbm.id FROM (healthplanpbm LEFT JOIN pbm ON ((healthplanpbm.pbmfid = pbm.id))) WHERE (healthplanpbm.pbmfunctionfid = 4)) mo1_pbm ON ((healthplan.id = mo1_pbm.healthplanfid))) LEFT JOIN (SELECT healthplanpbm.healthplanfid, pbm.name, pbm.id FROM (healthplanpbm LEFT JOIN pbm ON ((healthplanpbm.pbmfid = pbm.id))) WHERE (healthplanpbm.pbmfunctionfid = 7)) mo2_pbm ON ((healthplan.id = mo2_pbm.healthplanfid))) LEFT JOIN (SELECT healthplanpbm.healthplanfid, pbm.name, pbm.id FROM (healthplanpbm LEFT JOIN pbm ON ((healthplanpbm.pbmfid = pbm.id))) WHERE (healthplanpbm.pbmfunctionfid = 5)) rm_pbm ON ((healthplan.id = rm_pbm.healthplanfid))) WHERE (healthplan.isactive IS TRUE) ORDER BY custom_payors.id, parents.id, provider.id, healthplan.id, state.id);


